<section class="relative w-full min-h-screen flex items-center justify-center px-4 py-16 bg-[#050505] text-white"

        <div class="mt-1 md:mt-0 md:w-1/2 flex flex-col gap-1">

                        <span class="icon arrow"></span>

                </button>
            </a>
        </div>
